import React from 'react'
import socks from '../img/socks.png'
import s from './ProductCard.module.css'


export default function ProductCard({ id, title, price }) {
    return (
        <div>
            <h2 className='s.title'>{title}</h2>
            <p>{`Price: ${price}$`}</p>
            <img src={socks} alt="" srcset="" />
        </div>
    )
}
